import random

# EVOLVE-BLOCK-START
def run_search():
    n = 47
    # all grid points
    grid = [(x,y) for x in range(n) for y in range(n)]
    S = []
    random.shuffle(grid)
    for (x,y) in grid:
        ok = True
        for x1, y1 in S:
            # Check collinearity with existing points in S
            for x2, y2 in S:
                if (x1, y1) == (x2, y2):
                    continue
                # collinear iff (y2-y1)*(x - x1) == (y - y1)*(x2 - x1)
                if (y2 - y1)*(x - x1) == (y - y1)*(x2 - x1):
                    ok = False
                    break
            if not ok:
                break
        if ok:
            S.append((x, y))
    return S
